import React, { Component } from "react";
import axios from "axios";
import '../../components/common/2columns_layout.css';
import '../../components/common/2columns_layout.css';
import '../../components/common/PlaceBox.css';
import '../../pages/TopProvince/TopProvince.css';
import Navbar from '../common/navbarPage.js';
// import NextButton from '/Users/j.kanlaya/Downloads/Mike/website/geovisualization/src/components/common/NextButton.js';
import {Link} from 'react-router-dom';
import arrow from '../../images/TopProvince/12_arrow-right.png';
import styled from 'styled-components';

const StyledButton = styled(Link)`
    width: 60px;
    height: 100%;
    background-color: #5863F8;
    color: white;
    border: 0;
    display: flex;
    justify-content: center;
    align-items: center;
    background-image: url(${arrow});
    background-repeat: no-repeat;
    background-position: center;
    cursor: pointer;
`

export default class TopPlaces extends Component {
  state = {
    places: [],
    send_data: '',
    mapShow: false,
  }

  changeState = () => {   
    this.setState({
      send_data: this.state.places.placeName,
      mapShow: false
    });
  };  

  componentDidMount() {
    axios.get(`http://localhost:4000/getRankPlaces`)
      .then(res => {
        const places = res.data;
        this.setState({ places });
      })
  }

  render() {
    return (
      <div class="top layout placeBox">
          <Navbar />
          <div class="BGimg" />
          <div class="LayOut">
              <div class="PageTitle">Popular Province</div>
              <div class="PageBreadCrumbs">Home&emsp;|&emsp;Popular Province</div>
              <div class="Title">Top 10  Provinces <br /> in Thailand</div>
              <div class="row">
{/* Left column */}
                  <div class="column">
                      <div class="container">
                          <div class="Picture01" />
                          <div class="TextBox">
                              <div class="RankTop">1 ST</div>
                              {/* <div class="PlaceName">น่าน</div>
                              <div class="PlaceDesc">แข่งเรือลือเลื่อง เมืองงาช้างดำ จิตรกรรมวัดภูมินทร์ แดนดินส้มสีทอง เรืองรองพระธาตุแช่แห้ง</div> */}

                                {this.state.places.map(data => data.placeRank===1? 
                                  <>
                                    <div class="PlaceName">{data.placeName}</div>
                                    {/* <div class="PlaceDesc">{data.provinceDesc}</div> */}
                                  </>
                                  :null)}
                          </div>
                          {/* <NextButton onClick={this.changeState}/> */}

                          <StyledButton 
                            to="/top1Province" 
                            onClick={this.changeState}/>
                            {/* <MapComponents send_data={this.state.province.provinceTh}/> */}

                      </div>
                      <div class="container">
                          <div class="Picture03" />
                          <div class="TextBox">
                              <div class="RankTop">3 RD</div>
                              {/* <div class="PlaceName">ปราจีนบุรี</div>
                              <div class="PlaceDesc">ศรีมหาโพธิ์คู่บ้าน ไผ่ตงหวานคู่เมือง ผลไม้ลือเลื่อง เขตเมืองทวารวดี</div> */}
                              {this.state.places.map(data => data.placeRank===3? 
                                  <>
                                    <div class="PlaceName">{data.placeName}</div>
                                  </>
                                  :null)}
                          </div>
                          <StyledButton 
                            to="/top3Province" 
                            onClick={this.changeState}/>
                      </div>

{/* Right column */}
                  </div>
                  <div class="column">
                      <div class="container">
                          <div class="Picture02" />
                          <div class="TextBox">
                              <div class="RankTop">2 ND</div>
                              {/* <div class="PlaceName">สมุทรสงคราม</div>
                              <div class="PlaceDesc">เมืองหอยหลอด ยอดลิ้นจี่ มีอุทยาน ร.2 แม่กลองไหลผ่าน นมัสการหลวงพ่อบ้านแหลม</div> */}

                                {this.state.places.map(data => data.placeRank===2? 
                                  <>
                                    <div class="PlaceName">{data.placeName}</div>
                                  </>
                                  :null)}
                          </div>
                          <StyledButton 
                            to="/top2Province" 
                            onClick={this.changeState}/>
                      </div>
                      <div class="container">
                          <div class="Picture04" />
                          <div class="TextBox">
                              <div class="RankReg">4 TH</div>
                              {/* <div class="PlaceName">ระยอง</div>
                              <div class="PlaceDesc">ผลไม้รสล้ำ อุตสาหกรรมก้าวหน้า น้ำปลารสเด็ด เกาะเสม็ดสวยหรู สุนทรภู่กวีเอก</div> */}

                                {this.state.places.map(data => data.placeRank===4? 
                                  <>
                                    <div class="PlaceName">{data.placeName}</div>
                                  </>

                                  :null)}
                          </div>
                          <StyledButton 
                            to="/top4Province" 
                            onClick={this.changeState}/>
                      </div>

                  </div>
              </div>
          </div>
      </div>
    );
  }
}
